import React from 'react';
import './Article.scss';
import NavBar from '../ui/NavBar/NavBar';

const Article = () => {
    return (
        <header className='header-art'>
            <NavBar />
            <div className='wrap'>
                <div className='header-art__img'></div>
                <div className='header-art__title'></div>
                <div className='header-art__description'></div>
            </div>
        </header>
    );
};

export default Article;
